import React from 'react';
import '../Images/ufoInSF.png'
import Studies from './Profile/Studies';
import Languages from './Profile/Languages';
import Voluntering from './Profile/Voluntering';
import Experience from './Profile/WorkExperience';
import { Switch, Route, NavLink } from 'react-router-dom';
import '../app.css';

const Profile: React.SFC = () => {
  return (
    <section className="mw8 center avenir">
      <article className="bb b--black-10">
        <div className="flex flex-column flex-row-ns">          
          <div className="pr3-ns mb4 mb0-ns w-100 w-20-ns ph3 ph0-l">
            <ul className="list pl0 mt0 center">
              <NavLink to="/profile/languages"><li className="pointer lh-copy pv3 tc ba bl-0 bt-0 br-0 b--dotted b--black-30 bg-animate hover-bg-light-yellow">Languages</li></NavLink>
              <NavLink to="/profile/studies"><li className="pointer lh-copy pv3 tc ba bl-0 bt-0 br-0 b--dotted b--black-30 bg-animate hover-bg-light-blue">Studies</li></NavLink>
              <NavLink to="/profile/experience"><li className="pointer lh-copy pv3 tc ba bl-0 bt-0 br-0 b--dotted b--black-30 bg-animate hover-bg-light-pink">Experience</li></NavLink>
              <NavLink to="/profile/voluntering"><li className="pointer lh-copy pv3 tc ba bl-0 bt-0 br-0 b--dotted b--black-30 bg-animate hover-bg-light-green">Voluntering</li></NavLink>
            </ul>
          </div>
          <div className="w-100 w-75-ns pl5-ns">
            <Switch>
              <Route path="/profile/languages" render={() => <Languages />}/>
              <Route path="/profile/studies" render={() => <Studies />}/>
              <Route path="/profile/experience" render={() => <Experience />}/>
              <Route path="/profile/voluntering" render={() => <Voluntering />}/>
            </Switch>
            <h1 className="f3 fw1 baskerville mt0 lh-title">Tech Giant Invests Huge Money to Build a Computer Out of Science Fiction</h1>
            <p className="f6 f5-l lh-copy">
              The tech giant says it is ready to begin planning a quantum
              computer, a powerful cpu machine that relies on subatomic particles instead
              of transistors.
            </p>
            <p className="f6 lh-copy mv0">By Robin Darnell</p>
          </div>
        </div>
      </article>
    </section>  
  );
}

export default Profile;
